
import os
import pandas as pd
import numpy as np
import csv

reward_temp = []
reward_data = []


def save_reward(id, temp_data):
    """Save temporary reward data"""
    global reward_temp
    reward_temp.append([id, temp_data])

def save_ep_data(ep):
    """Save data for the current ep"""
    global reward_temp
    global reward_data

    for i in reward_temp:
        i.insert(0, ep)
    reward_data += reward_temp
    reward_temp = []  # Clear temporary variable

def save_data_to_file():
    """Save data to a file"""
    global reward_data

    cur_dir = os.path.join(os.getcwd(), 'save_data')
    
    #
    csv_rewards = open(cur_dir+'\\reward_data.csv', 'w', newline='')
    name_rewards = ['episode', 'id','rewards']
    try:
        writer = csv.writer(csv_rewards)
        writer.writerow(name_rewards)
        for i in range(len(reward_data)):
            writer.writerow(reward_data[i])
    finally:
        csv_rewards.close()

